script: |
  super -f text -I q10290.spq | sort > q10290.out

inputs:
  - name: q10290.spq
    data: |
      SELECT ALL col2 - col0 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE col0 >= ( 65 * + ( - col2 ) * col2 - - col0 );
  - name: tab2

outputs:
  - name: q10290.out
    data: |
      -17
      -23
      -24
